          <p>{location.name}</p>
          <p>{location.email}</p>
          <p>{location.phone}</p>
          <p>location.availability</p>
          <a onClick={() => this.deleteListing(location._id)}>Delete Listing</a>
          </h4>
        ))}
      </div>
    )
  }


}


export default Test;

